Le programme BioLit a pour objectif de mobiliser et associer tous les publics sur des problématiques scientifiques qui permettront de mieux connaître la biodiversité littorale pour mieux la protéger. Cela doit permettre de :
- répondre à des grandes problématiques scientifiques en structurant et mobilisant les réseaux adéquats faisant appel au “grand public” ;
- faire émerger des problématiques répondant aux préoccupations des usagers du littoral et mettre en œuvre des dispositifs pour y répondre ;
- sensibiliser tous les publics concernés à la fragilité et à la diversité du littoral en utilisant le vecteur que représente la science participative pour y parvenir. 
Sur le long terme, l’objectif de BioLit est de disposer d’informations précises et régulières sur l’état du littoral afin d’améliorer les mesures de gestion et de protection de ces écosystèmes particuliers.

